import React, { useEffect } from 'react';

const ReadData = ({ GHI, fetchGHI, onEdit, onDelete }) => {
  // 데이터 가져오기
  useEffect(() => {
    fetchGHI();
  }, [fetchGHI]);

  return (
    <div>
      <h2>GHI Records</h2>
      {GHI.length === 0 ? (
        <p>No data available.</p>
      ) : (
        <ul>
          {GHI.map((item) => (
            <li key={item.id} style={{ marginBottom: '10px' }}>
              <div>
                <strong>Country:</strong> {item.country}, <strong>Year:</strong> {item.year}, <strong>GHI:</strong> {item.ghi}
                <br />
                <strong>Stunting:</strong> {item.child_stunting}, <strong>Wasting:</strong> {item.child_wasting}, 
                <strong> Undernourishment:</strong> {item.undernourishment}, <strong>Mortality:</strong> {item.child_mortality}
              </div>
              <button
                onClick={() => onEdit(item)}
                style={{ marginRight: '10px', padding: '5px 10px' }}
              >
                Edit
              </button>
              <button
                onClick={() => {
                  if (window.confirm('Are you sure you want to delete this record?')) {
                    onDelete(item.id);
                  }
                }}
                style={{ padding: '5px 10px', backgroundColor: 'red', color: 'white' }}
              >
                Delete
              </button>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default ReadData;
